import React from 'react';
import logo from './logo.svg';
import './App.css';

class App extends React.Component {
  componentDidMount() {
    fetch('api.openweathermap.org/data/2.5/weather?q=Lehi&appid=f6c3ead84e4c7b12a7cbe6d6dd18c102')
    .then(res => res.json())
    .then(json => {
      console.log(json);
    })
  }
  render() {
    return (
      <div>
        hello world
      </div>
    )
  }
}

export default App;
